import Formulario from './components/form';
import { BrowserRouter, Routes,Route } from 'react-router-dom';

function App() {
  return(
    <div>
      <BrowserRouter>
        <Routes>
          <Route />
        </Routes>
      </BrowserRouter>
<Formulario titleName={"Formulario de Ventas"}
        labelName={"Datos del Cliente"}
        buttonName={"Guardar"}/>
    </div>
  
        
    )
    
  }

export default App;
